declare namespace org {
    namespace springframework {
        namespace web {
            namespace bind {
                namespace support {
                    /**
                     * Simple implementation of the {@link SessionStatus} interface,
                     * keeping the {@code complete} flag as an instance variable.
                     * @author Juergen Hoeller
                     * @since 2.5
                     */
                    // @ts-ignore
                    class SimpleSessionStatus extends java.lang.Object implements org.springframework.web.bind.support.SessionStatus {
                        // @ts-ignore
                        constructor()
                        // @ts-ignore
                        public setComplete(): void
                        // @ts-ignore
                        public isComplete(): boolean
                    }
                }
            }
        }
    }
}
